import React from 'react';
import PropTypes from 'prop-types';

const isPrivateRoute = props => {
    const { pathName, ...isPrivateRouteProps } = props;

    return console.log(pathName.includes('/app'));
};

isPrivateRoute.propTypes = {};

export default isPrivateRoute;
